import React from "react";
import { Link } from "react-router-dom";
import bannerImg from "./img/fin.jpg";
import "./profile.css"; // Import profile.css instead of AboutUs.css
import Container from "react-bootstrap/Container";
import logoftp from "./img/fin.jpg";
import avatar from "./img/fin.jpg";
import abdur from "./img/fin.jpg";
import Thani from "./img/fin.jpg";

const About = () => {
  return (
    <div className="profile-page">
      <div className="profile-picture">
        <img src={avatar} alt="Avatar" className="profile-img" />
      </div>
      <div className="dashboard">
        <h2 className="dashboard-title">Welcome Back Alex!</h2>
        <p className="dashboard-text">
          You are on the right side Alex! See what we got for you!
        </p>
        <div className="grid-container">
          <div className="grid-item">
            <img className="banner-img" src={avatar} alt="Bannerimg" />
            <h4 className="font-weight-bold dark-grey-text mt-4">Alex</h4>
            <h6 className="font-weight-bold blue-text my-3">
              VIP Customer: 1300 XRPs!
            </h6>
            <p className="font-weight-normal dark-grey-text"></p>
          </div>
          <div className="grid-item">
            <Calculator />
          </div>
          <div className="grid-item">
            <LandingPage />
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
